import React from "react";
import Table from "react-bootstrap/esm/Table";
import DisplayShifts from "../DisplayShifts";

const ShiftTable = (props) => {
    const { shift } = props;

    return (
        <Fragment>
            {props.getAllShiftsProperty &&
                props.getAllShiftsProperty.map((shift, index) => {
                    return(
                        <Table striped bordered hover size="sm">
                            <thead>
                                <tr>
                                    <th>Shift</th>
                                    <th>Start Time</th>
                                    <th>End Time</th>
                                    <th>Certification Requiried</th>
                                    <th>Assigned Nurse</th>
                                </tr> 
                            </thead>
                            <tbody>
                                <tr>
                                    <td>{shift.name}</td>
                                    <td>{shift.start}</td>
                                    <td>{shift.end}</td>
                                    <td>{shift.qual_required}</td>
                                    <td>{shift.nurse_id}</td>
                                </tr>
                            </tbody>
                        </Table>
                    )
                }
            )}
        </Fragment>
    );
}
 
export default ShiftTable;
